import React from "react";

function Post({ post, onLike }) {
  return (
    <div style={{ border: "1px solid black", margin: "10px", padding: "10px" }}>
      <h2>{post.title}</h2>
      <p>Likes: {post.likes}</p>
      <button onClick={onLike}>Like</button>
    </div>
  );
}

export default Post;
